import { Link } from "react-router-dom"

const EventsPage = ()=>{    
    const EVENT = [
        {id: "e1", name: "Event 1"},
        {id: "e2", name: "Event 2"},
        {id: "e3", name: "Event 3"},
        {id: "e4", name: "Event 4"},
    ]

    return (
        <>
            <h1>Event Page</h1>
            <ul>
                {EVENT.map(event=>{
                    <li key={event.id}><Link to={`${event.id}`}>{event.name}</Link></li>
                })}
            </ul>
        </>
    )
}
export default EventsPage
